  const { openSidebar, openSubmenu, closeSubmenu } = useGlobalContext();


  // display nav links
  const displayNavLinks = () => {};

  return (
    <nav className='nav'>
      <div className='nav-center'>
        <div className='nav-header'>
          <img
            className='nav-logo'
            src={logo}
            alt='stripe'
          />
          <button
            className='btn'><FaBars/></button>        
        </div>

        <ul className='nav-links'>
          { displayNavLinks }
        </ul>
      </div>
    </nav>
  );
}

export default Navbar
